import { Link } from 'react-router-dom';

 function Header() {
    return (

<header style={headerStyle}>
            <h1 title="Home" style={{ cursor: 'pointer' }}>   <Link style={linkStyle} to="/">My Todo </Link></h1>
            <Link to="/today">Today</Link> || <Link to="/week">Weekly</Link>  <Link to="/month">Monthly</Link>








</header>

    )
}








